import { useLocation } from "react-router-dom";
import ColumnHeaderTable from "../ColumnHeaderTable";
import { Container, Wrap, TableSection, FormButton } from './InstanceElements'

const Instance = props => {
    const location = useLocation();
    const rowData = (location.state && location.state.rowData) || {};

    const headerItems = [
        { name: "id", label: "ID" },
        { name: "chain", label: "Chain" },
        { name: "size", label: "Size" },
        { name: "created", label: "Date Created" },
        { name: "solution", label: "Solution" },
        { name: "solved", label: "Solved" },
        { name: "ended", label: "Date Solution" },
    ]
    return (
        <Container>
            <Wrap>
                <TableSection>
                    <ColumnHeaderTable headerItems={headerItems} data={rowData} footer></ColumnHeaderTable>
                </TableSection>
            </Wrap>
            <div style={{ textAlign: "center" }}>
                <FormButton type="submit" value="Resolve" />
            </div>
        </Container>
    );
}

export default Instance;
